"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Echocardiogram four-chamber post MI mitral regurgitation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 257px; height: 436px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
