"     Brand Names: Canada",
"    </span>",
"    <ul>",
"     <li>",
"      Fluor-A-Day",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"list_set htclist drugH1Div drugBrandNames\" id=\"F1058730\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Therapeutic Category",
"    </span>",
"    <ul>",
"     <li>",
"      <span class=\"list-set-name\">",
"       Mineral, Oral",
"      </span>",
"     </li>",
"     <li>",
"      <span class=\"list-set-name\">",
"       Mineral, Oral Topical",
"      </span>",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block don drugH1Div\" id=\"F11442538\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Neonatal",
"    </span>",
"    <p style=\"text-indent:0em;text-align:justify;display:inline\">",
"     Adequate Intake (AI): 0.01 mg/day; supplementation is not recommended in neonates",
"    </p>",
"   </div>",
"   <div class=\"block dos drugH1Div\" id=\"F1058725\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Usual",
"    </span>",
"    <p>",
"     (For additional information",
"     <a class=\"drug drug_general\" href=\"mobipreview.htm?4/33/4632?source=see_link\">",
"      see \"Fluoride: Drug information\"",
"     </a>",
"     )",
"    </p>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Oral:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Adequate Intake (AI):",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Infants, Children, and Adolescents:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     0-6 months: 0.01 mg/day; additional supplementation is not recommended in infants &lt;6 months of age",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     7-12 months: 0.5 mg/day",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     1-3 years: 0.7 mg/day",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     4-8 years: 1 mg/day",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     9-13 years: 2 mg/day",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     14-18 years: 3 mg/day",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Adults:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Males: 4 mg/day",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Females: 3 mg/day",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     The recommended daily fluoride intake is adjusted in proportion to the fluoride content of available drinking water; see",
"     <b>",
"      Recommended Daily Fluoride Dose",
"     </b>",
"     table",
"    </p>",
"    <table border=\"1\" frame=\"border\" rules=\"all\">",
"     <caption style=\"text-align:center;\">",
"      Recommended Daily Fluoride Dose",
"     </caption>",
"     <col align=\"left\" width=\"175\">",
"     </col>",
"     <col align=\"center\" width=\"150\">",
"     </col>",
"     <thead valign=\"middle\">",
"      <tr>",
"       <th align=\"center\">",
"        <p style=\"text-indent:0em;\">",
"         Fluoride Content of Drinking Water",
"        </p>",
"       </th>",
"       <th align=\"center\">",
"        <p style=\"text-indent:0em;\">",
"         Daily Dose, Oral Fluoride",
"        </p>",
"        <p style=\"text-indent:0em;\">",
"         (mg)",
"        </p>",
"       </th>",
"      </tr>",
"     </thead>",
"     <tfoot valign=\"middle\">",
"      <tr>",
"       <td align=\"left\" colspan=\"2\">",
"        <p style=\"text-indent:0em;\">",
"         Adapted from",
"         <i>",
"          AAP News",
"         </i>",
"         , 1995, 11(2):18.",
"        </p>",
"       </td>",
"      </tr>",
"     </tfoot>",
"     <tbody valign=\"middle\">",
"      <tr>",
"       <td align=\"left\">",
"        <p style=\"text-indent:0em;\">",
"         <b>",
"          &lt;0.3 ppm",
"         </b>",
"        </p>",
"       </td>",
"       <td align=\"center\">",
"       </td>",
"      </tr>",
"      <tr>",
"       <td align=\"left\">",
"        <p style=\"text-indent:2em;\">",
"         Birth - 6 mo",
"        </p>",
"       </td>",
"       <td align=\"center\">",
"        <p style=\"text-indent:0em;\">",
"         0",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td align=\"left\">",
"        <p style=\"text-indent:2em;\">",
"         6 mo to 3 y",
"        </p>",
"       </td>",
"       <td align=\"center\">",
"        <p style=\"text-indent:0em;\">",
"         0.25",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td align=\"left\">",
"        <p style=\"text-indent:2em;\">",
"         3-6 y",
"        </p>",
"       </td>",
"       <td align=\"center\">",
"        <p style=\"text-indent:0em;\">",
"         0.5",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td align=\"left\">",
"        <p style=\"text-indent:2em;\">",
"         6-16 y",
"        </p>",
"       </td>",
"       <td align=\"center\">",
"        <p style=\"text-indent:0em;\">",
"         1",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td align=\"left\">",
"        <p style=\"text-indent:0em;\">",
"         <b>",
"          0.3-0.6 ppm",
"         </b>",
"        </p>",
"       </td>",
"       <td align=\"center\">",
"       </td>",
"      </tr>",
"      <tr>",
