"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Acidulated phosphate fluoride rinse: Children 6 years and Adults: 5-10 mL of 0.02% daily at bedtime",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;margin-top:2em;text-align:justify;\">",
"     Gel:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Acidulated phosphate fluoride: Adults: 4-8 drops of 0.5% gel daily or for desensitizing exposed root surfaces, use a few drops of 0.5% to 1.2% gel applied and brushed onto affected area each night",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Stannous fluoride: Children &gt;6 years and Adults: Apply 0.4% gel to teeth once daily",
"    </p>",
"   </div>",
