"      Patient information: Headache in children (Beyond the Basics)",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_basics\" href=\"mobipreview.htm?26/29/27090?source=related_link\">",
"      Patient information: Headaches in children (The Basics)",
"     </a>",
