var title_f33_59_34747="Treatment for Bartonellosis";
var content_f33_59_34747=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F77298&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F77298&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Antimicrobial therapy for Bartonellosis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Phase of illness",
"      </td>",
"      <td class=\"subtitle1\">",
"       Adult therapy",
"      </td>",
"      <td class=\"subtitle1\">",
"       Pediatric therapy",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"6\">",
"       Acute (Oroyo fever)",
"      </td>",
"      <td>",
"       <strong>",
"        Regimen of choice:",
"       </strong>",
"      </td>",
"      <td rowspan=\"6\">",
"       <p>",
"        Chloramphenicol: 50-75 mg/kg/day PO or IV divided in 4 doses x 14d",
"       </p>",
"       <p>",
"        <strong>",
"         PLUS",
"        </strong>",
"       </p>",
"       <p>",
"        Another antimicrobial (Beta-lactam agent preferred)",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Chloramphenicol: 500 mg PO or IV qid x 14d",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       <strong>",
"        PLUS",
"       </strong>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Another antimicrobial (Beta-lactam agent preferred)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <strong>",
"        Alternative:",
"       </strong>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Doxycycline: 100 mg PO bid x 14d",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"4\">",
"       Eruptive (Verruga peruana)",
"      </td>",
"      <td>",
"       <strong>",
"        Drug of choice:",
"       </strong>",
"      </td>",
"      <td rowspan=\"4\">",
"       Rifampin: 10 mg/kg/d PO x 14d (maximum total daily dose of 600 mg/d)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Rifampin: 10 mg/kg/d PO x 14d",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <strong>",
"        Alternative:",
"       </strong>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Streptomycin: 15-20 mg/kg/d IM x 10d",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
