var title_f33_59_34748="Indications for ventilation";
var content_f33_59_34748=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F66496&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F66496&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Respiratory abnormalities suggestive of the need for mechanical ventilation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"2\" width=\"50%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Parameter",
"       </td>",
"       <td class=\"subtitle1\">",
"        Value",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Clinical assessment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Apnea",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Stridor",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Severely depressed mental status",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Flail chest",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Inability to clear respiratory secretions (eg, excessive secretions, loss of protective reflexes, neuromuscular failure)",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Trauma to mandible, larynx, trachea",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Loss of ventilatory reserve",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Respiratory rate",
"       </td>",
"       <td>",
"        &gt;35 breaths/min",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Tidal volume",
"       </td>",
"       <td>",
"        &lt;5 mL/kg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Vital capacity",
"       </td>",
"       <td>",
"        &lt;10 mL/kg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Negative inspiratory force",
"       </td>",
"       <td>",
"        Weaker than -25 cm H",
"        <sub>",
"         2",
"        </sub>",
"        O (2.44 kPa)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Minute ventilation",
"       </td>",
"       <td>",
"        &lt;10 L/min",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Rise in PaCO",
"        <sub>",
"         2",
"        </sub>",
"       </td>",
"       <td>",
"        &gt;10 mmHg (1.33 kPa)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Refractory hypoxemia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Alveolar-arterial gradient (FiO",
"        <sub>",
"         2",
"        </sub>",
"        = 1)",
"       </td>",
"       <td>",
"        &gt;450",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        PaO",
"        <sub>",
"         2",
"        </sub>",
"        /PAO",
"        <sub>",
"         2",
"        </sub>",
"       </td>",
"       <td>",
"        &lt;0.15",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        PaO",
"        <sub>",
"         2",
"        </sub>",
"        with supplemental O",
"        <sub>",
"         2",
"        </sub>",
"       </td>",
"       <td>",
"        &lt;55 mmHg (7.32 kPa)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     PaCO",
"     <sub>",
"      2",
"     </sub>",
"     : arterial tension of carbon dioxide; FiO",
"     <sub>",
"      2",
"     </sub>",
"     : fraction of inspired oxygen; PaO",
"     <sub>",
"      2",
"     </sub>",
"     : arterial tension of oxygen; PAO",
"     <sub>",
"      2",
"     </sub>",
"     : alveolar tension of oxygen.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
