"    Tympanosclerosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 396px; height: 399px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Tympanosclerosis, asymptomatic whitish plaques of calcium and phosphate crystals, as depicted above, is common in children with middle ear disease and more common after&nbsp;tympanostomy tube placement.",
